fun test(s0: String, s1: String, s2: String): String {
    return s0 + "" +
            s1 + "53091531015311153121531315314153151531615317153181531915320153211532215323153241532515326153271532815329" + s2
}

fun test2(s0: String, s1: String): String {
    return s0 + "" + s1
}

fun test3(): String {
    return ""
}

fun box() : String {
    if (test("", "", "").length != 65539) return "fail 1: ${test("", "", "").length}"
    if (test("", "", "") != test2("", "")) return "fail 2: ${test("", "", "")} != ${test2("", "")}"
    if (test("", "", "") != test3()) return "fail 3: ${test("", "", "")} != ${test3()}"

